import React from "react";
import {Text, View, StyleSheet, Image} from 'react-native';

const App = () => {
  return (

    <View style={style.container}>
      <Text style = {style.title}>Hello World!</Text>
      <Image 
        source = {{uri: 'https://images.unsplash.com/photo-1634324040880-63dbf9a4e5ac?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=387&q=80'}}
        style = {{height : 400, width: 200}}
      />
    </View>  

  )
};

const style = StyleSheet.create({
  container : {
  flex: 1, 
  justifyContent: "center",
  alignItems: "center",
  backgroundColor: '#292929'},

  title : {
    fontSize : 30,
    color: '#ffff'},
})

export default App;
